import React from "react";
import Video from "../../videos/video1.mp4";
import { HeroContainer, HeroBg, VideoBg } from "./HeroElement";
const HeroSection = () => {
  return (
    <HeroContainer>
      <HeroBg>
        <VideoBg autoPlay loop muted src={Video} type="video/mp4"></VideoBg>
      </HeroBg>
    </HeroContainer>
  );
};

export default HeroSection;
